- input: "TEXT\x1CC00071365\x1CX0\x1C\x1CF3XA\x1CThis amendment includes the following
    updates.  Coordinated expenditures for Charles J. Melancon and Ravi Sangisetty
    were made with a share of the 441a(d) authority from the Democratic Senatorial
    Campaign Committee and Democratic Congressional Campaign Committee.  Our original
    report inadvertently failed to check the box for a designated committee.  This
    amended report has corrected that error and all expenditures made were done within
    the limits under 2 U.S.C. 441a(d).      We have issued a check for $5000.00 to
    Laura Leach and $1100.00 to Remy Voisin Starns for contribution refunds for excessive
    contributions.  These refunds will be reported on our 2011 June Monthly report.
    \   Schedule F totals for Charles J. Melancon and Cedric Richmond have been updated
    to reflect correct aggregate totals for each of these candidates.    Totals for
    Line 21 (a)(ii), Column B has been updated to reflect the correct Calendar Year-to-Dare
    total.    On schedule 21 line 30(b) is expenditure for ?volunteer exempt signs?.
    \ This expenditure meets all criteria for a volunteer exempt activity.  These
    sign were not paid for with transfer down funds from any national affiliated committees,
    but rather home grown funds to the DSCC Federal of LA    Disbursements for ?Slate
    Card distribution featured both federal and non-federal candidates and did not
    contain federal election activity.  The listings featured at least three candidates
    and were distributed by hand.  Furthermore the content of the slate cards were
    limited to candidate?s name, office sought and ballot number, therefore meeting
    the definition for slate card/exempt activity in accordance with 11 C.F.R. 106.7(c)(3).
    \   All disbursements for ?organizational/grassroots consu? have been changed
    to clarify the proper description(s).    On schedule F some of the disbursements
    were missing candidate information.  All items on Schedule F have been updated
    and now include all candidate information.      All disbursements on Line 21(b)
    for ?Generic Party Building Nwspr Ad? and ?Generic Party Building Radio Ad? did
    not mention or contain any federal candidates.   We have updated  the descriptions
    of these disbursements to include ?Non-FEA?    All disbursements that are reported
    administrative are administrative and are not in connection with a federal candidate
    or election.  Salaries paid on the administrative split are for employees who
    spend less than 25% of their work hours on federal election activity. All payments
    for payroll, payroll taxes and insurance that are reported as administrative are
    not paid on behalf of employees who spend more than 25% of there work time on
    federal election activity.   Salaries reported on line 21b are for employees who
    spend less than 25% of their work hours on federal election activity. All payments
    for payroll, payroll taxes and insurance that are reported on line 21b are not
    paid on behalf of employees who spend more than 25% of there work time on federal
    election activity.  Please note the Louisiana Democratic Party owns it own building
    and therefore does not make regular rent payments.    \n"
